import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Button } from '@mui/material';
import logo from '../images/logo.svg'; // Adjust the path to where your logo.svg is located
import '../styles/Navbar.css'; // Import the CSS file

const Navbar = () => {
    return (
      <AppBar
        position="static"
        sx={{
          backgroundColor: 'white',
          boxShadow: 'none', // Remove box-shadow if needed
        }}
      >
        <Toolbar>
          <img
            src={logo}
            alt="Logo"
            className="navbar"
          />
          <Button
            color="inherit"
            component={Link}
            to="/"
            sx={{ color: '#333' }} // Override button color
          >
            Home
          </Button>
          <Button
            color="inherit"
            component={Link}
            to="/services"
            sx={{ color: '#333' }} // Override button color
          >
            Services
          </Button>
          <Button
            color="inherit"
            component={Link}
            to="/contact"
            sx={{ color: '#333' }} // Override button color
          >
            Contact Us
          </Button>
          <Button
            color="inherit"
            component={Link}
            to="/location"
            sx={{ color: '#333' }} // Override button color
          >
            Location
          </Button>
        </Toolbar>
      </AppBar>
    );
  };

  export default Navbar;
